import './App.css';
import {Routes, Route} from 'react-router-dom'
import { Link } from 'react-router-dom'
import StarshipsList from './components/StarshipsList';

function App() {
  return (
    <div className="App">
      <nav>
        <Routes>
          <Link to="StarShip"><StarshipsList/></Link>
        </Routes>
      </nav>
    </div>
  );
}

export default App;
